import useFetch from "./useFetch";
import "./Detail.css"



const PostDetail = () => {
    const {id} = useParams()
    const {data, pending, error} = useFetch('http://localhost:8000/items/' + id)

    return (
        <main className="detail-container">
            <div className="detail-image"></div>
        </main>
    );
}

export default PostDetail;
